        \"The SI unit of flux density (or field intensity) for magnetic fields (also
        called the magnetic induction). The intensity of a magnetic field can be measured
        by placing a current-carrying conductor in the field. The magnetic field exerts
        a force on the conductor, a force which depends on the amount of the current
        and on the length of the conductor. One tesla is defined as the field intensity
        generating one newton of force per ampere of current per meter of conductor.
        Equivalently, one tesla represents a magnetic flux density of one weber per
        square meter of area. A field of one tesla is quite strong: the strongest
        fields available in laboratories are about 20 teslas, and the Earth's magnetic
        flux density, at its surface, is about 50 microteslas. The tesla, defined
        in 1958, honors the Serbian-American electrical engineer Nikola Tesla (1856-1943),
        whose work in electromagnetic induction led to the first practical generators
        and motors using alternating current. \\\\(T =  V\\\\cdot s \\\\cdot m^{-2}
        = N\\\\cdot A^{-1}\\\\cdot m^{-1} = Wb\\\\cdot m^{-1} = kg \\\\cdot  C^{-1}\\\\cdot
        s^{-1}\\\\cdot A^{-1} = kg \\\\cdot s^{-2}\\\\cdot A^{-1} = N \\\\cdot s \\\\cdot
        C^{-1}\\\\cdot m^{-1}\\\\) where, \\\\(\\\\\\\\\\\\) \\\\(A\\\\) = ampere,
        \\\\(C\\\\)=coulomb, \\\\(m\\\\) = meter,  \\\\(N\\\\) = newton, \\\\(s\\\\)
        = second, \\\\(T\\\\) = tesla, \\\\(Wb\\\\) = weber\"^^qudt:LatexString ;\n
