        ;\n  rdfs:label \"T-SEC\"@en ;\n.\nunit:TBSP\n  a qudt:Unit ;\n  dcterms:description
        \"In the US and parts of Canada, a tablespoon is the largest type of spoon
        used for eating from a bowl. In the UK and most Commonwealth countries, a
        tablespoon is a type of large spoon usually used for serving. In countries
        where a tablespoon is a serving spoon, the nearest equivalent to the US tablespoon
        is either the dessert spoon or the soup spoon. A tablespoonful, nominally
        the capacity of one tablespoon, is commonly used as a measure of volume in
        cooking. It is abbreviated as T, tb, tbs, tbsp, tblsp, or tblspn. The capacity
        of ordinary tablespoons is not regulated by law and is subject to considerable
        variation. In most countries one level tablespoon is approximately 15\_mL;
        in Australia it is 20\_mL.\"^^rdf:HTML ;\n  qudt:conversionMultiplier 0.0000147867656
