        cycle of seasons, as seen from Earth; for example, the time from vernal equinox
        to vernal equinox, or from summer solstice to summer solstice. Because of
        the precession of the equinoxes, the seasonal cycle does not remain exactly
        synchronised with the position of the Earth in its orbit around the Sun. As
        a consequence, the tropical year is about 20 minutes shorter than the time
        it takes Earth to complete one full orbit around the Sun as measured with
        respect to the fixed stars. Since antiquity, astronomers have progressively
        refined the definition of the tropical year, and currently define it as the
        time required for the mean Sun's tropical longitude (longitudinal position
        along the ecliptic relative to its position at the vernal equinox) to increase
